con:config.script:
import jxl.*

def filepath = "C:/Users/GagandeepPanesar/Downloads/Soap_UI/Project/SoapUI-E2E/Data.xls"
File excel = new File(filepath)
Workbook wb = Workbook.getWorkbook(excel)
Sheet sh = wb.getSheet("Sheet1")
def rowsize = sh.getRows().toInteger();
def columnsize = sh.getColumns().toInteger();
def tc = testRunner.testCase.testSuite.project.testSuites["ProductTesting"].testCases["Verify E2E functionality"]

for(def i=0;i<rowsize;i++)
{
	for(def j=0;j<columnsize;j++)
	{
		if(j==0)
		{
			def sku = sh.getCell(j,i).getContents()
			tc.testSteps["Properties"].setPropertyValue("sku", sku )
		}
		else
		{
			def name = sh.getCell(j,i).getContents()
			tc.testSteps["Properties"].setPropertyValue("name", name )
		}

	}
	def runner = tc.run( null, false )
}

import com.eviware.soapui.support.XmlHolder

def response = context.expand('${JDBCRequest#ResponseAsXml}')
def holder = new XmlHolder(response)
def tc = testRunner.testCase.testSuite.project.testSuites["ProductTesting"].testCases["Verify E2E functionality"]

for(def i=1;i<=1;i++)
{
	sku = holder.getNodeValue('//ResultSet/Row['+i+']/PRODDETAILS.SKU')
	tc.testSteps["Properties"].setPropertyValue("sku", sku )

	name = holder.getNodeValue('//ResultSet/Row['+i+']/PRODDETAILS.NAME')	
	tc.testSteps["Properties"].setPropertyValue("name", name )

	def runner = tc.run( null, false )
}

import com.eviware.soapui.model.testsuite.TestRunner.Status

// get TestCase
def tc = testRunner.testCase.testSuite.project.testSuites["ProductTesting"].testCases["Verify E2E functionality"]

// set credential properties from the script itself
tc.testSteps["Properties"].setPropertyValue("sku", "SKU00001" )
tc.testSteps["Properties"].setPropertyValue("name", "iPhone 7" )

// run test synchrouously
def runner = tc.run( null, false )

// show the test case result status
log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info "Number of test steps which ran: " + runner.results.size()

// assert that it didn't fail
assert runner.status != Status.FAILED : runner.reason

// assert that only four steps ran!!
assert runner.results.size() == 7

