con:config.script:
import groovy.json.JsonSlurper
import jxl.*
import java.io.*
import jxl.write.*

def response = testRunner.testCase.testSteps["Get list of categories by depth level"].getPropertyValue("Response")
def resObj = new JsonSlurper().parseText(response)
def category = resObj.data.name
def sub_category = resObj.data.categories.name


def path = "C:/Users/GagandeepPanesar/Downloads/Soap_UI/Project/SoapUI-E2E/Data_write.xls"
File fr = new File(path)
Workbook wk = Workbook.getWorkbook(fr);
WritableWorkbook wr = Workbook.createWorkbook(fr, wk);

WritableSheet sh= wr.getSheet(0);

for(def i=0;i<category.size();i++)
{
Label data_cat = new Label(0,i,category[i]); 
sh.addCell(data_cat);
Label data_sub_cat = new Label(1,i,sub_category[i].toString()); 
sh.addCell(data_sub_cat);
}

wr.write();
wr.close();
